import landing from './landing.svg';
import fdlogo from './fd_logo.svg';
import './App.css';
import React from "react";
import {useAuth0} from "@auth0/auth0-react";
import {Button} from "@material-ui/core";

const LoginButton = () =>{
    const { loginWithRedirect } = useAuth0();
    return <Button variant="contained"
                   color="primary"
                   size="large"
                   onClick={() => loginWithRedirect()}>Start working</Button>;
}
function App() {
    const avatar = useAuth0().isAuthenticated ? "https://s.gravatar.com/avatar/afe5d2f67de43e86ffef7ac5661082bb?s=480&r=pg&d=https%3A%2F%2Fcdn.auth0.com%2Favatars%2Fma.png" : landing;
  return (
    <div className="Landing-page">

        <img src={fdlogo} className="FD-logo" alt="FranDine Company Logo"/>
        <img src={avatar} className="Landing-logo" alt="Company logo"/>
        <LoginButton/>

    </div>

  );
}

export default App;
